import React from "react";

export const ContactPicker = ({ onChange, value, name, contact }) => {
  return (
    <>
      <select
        className="select"
        name={name}
        onChange={onChange}
        value={value}
        contact={contact}
      >
        <option value={""}>No contact selected</option>
        <option></option>
      </select>
    </>
  );
};
